'From nsboot-2014-07-25 of 25 July 2014 [latest update: #11860] on 27 July 2014 at 12:42:26 pm'!!Array methodsFor: 'self evaluating' stamp: 'sd 7/31/2005 21:44'!printAsLiteralFormOn: aStream	aStream nextPut: $#.	self printElementsOn: aStream! !!Character methodsFor: 'printing' stamp: 'gbracha 7/25/2014 18:48'!printOn: aStream	| name |	(value > 32 and: [value ~= 127])		ifTrue: [ aStream nextPut: $"; nextPut: self ; nextPut: $"]		ifFalse: [			name := self class constantNameFor: self.			name notNil				ifTrue: [ aStream nextPutAll: self class name; space; nextPutAll: name ]				ifFalse: [ aStream nextPutAll: self class name; nextPutAll: ' value: '; print: value ] ].! !!Character class methodsFor: 'as yet unclassified' stamp: 'gbracha 7/27/2014 12:40'!doubleQuote	^$"! !Character removeSelector: #doubleQuote!